use std::collections::HashMap;
use std::sync::LazyLock;

/// Lookup map for multiwords by lowercase phrase
pub static FR_MULTIWORD_LOOKUP: LazyLock<HashMap<String, &'static MultiwordEntry>> = LazyLock::new(|| {
	let mut map = HashMap::new();
	for entry in FR_MULTIWORDS {
		map.insert(entry.phrase.to_lowercase(), entry);
	}
	map
});

/// Get multiword entry for a phrase (case-insensitive)
pub fn get_fr_multiword(phrase: &str) -> Option<&'static MultiwordEntry> {
	FR_MULTIWORD_LOOKUP.get(&phrase.to_lowercase()).copied()
}
